INSERT INTO `sys_oper_log` VALUES (142, 'port', 1, 'com.ruoyi.web.controller.port.BPortController.add()', 'POST', 1, 'admin', NULL, '/port/port', '127.0.0.1', '内网IP', '{\"params\":{},\"portContact\":\"400-0518-999\",\"portFacilities\":\"- **航道**  30万吨级航道水深超过20米，辟有3条远洋干线、27条近洋航线、8条内支线、16条内贸线、4条海河线、2条客货班轮航线和20条杂货班轮航线，与全球150多个国家和地区、近千个港口进行通航往来；辟有至阿拉木图等中亚班列、至伊斯坦布尔等中欧班列2条精品通道和至中西部地区10条海铁联运班列，海河江、铁公水的综合交通运输体系完备，多式联运发展水平位居全国前列。   - **泊位**  1985年，连云港港有生产泊位9个，其中1万吨级以上泊位5个；仓库和堆场货物总容量23万吨；装卸机械444台，完成[货物吞吐量](https://baike.baidu.com/item/货物吞吐量/7040946?fromModule=lemma_inlink)929万吨，其中外贸货物523万吨，主要货种为煤炭。  截止2003年末，连云港港拥有生产性泊位30个，其中万吨级以上泊位25个，包括煤炭、集装箱、木材、粮食、危险品等专业码头，泊位岸线6 273米，年设计吞吐能力2 265万吨；目前已形成老港区、庙岭港区、墟沟港区三大港区，已经成为一个初具规模，大中小泊位配套，散杂货、集装箱并举，运输功能齐全，内外贸兼顾，以外贸运输为主的综合性国际贸易运输枢纽港。  截至2011年底，连云港港拥有生产性泊位59个（万吨级以上泊位40个，货物通过能力达到5803万吨，集装箱能力达341万TEU。  截至2013年末，连云港港拥有集装箱、矿石、焦炭、煤炭、散粮、液体化工等万吨级以上泊位48个，港口吞吐能力达1.1亿吨，集装箱吞吐能力达340万标箱。\",\"portImage\":\"/profile/upload/2023/12/06/连云港港_20231206160842A001.jpeg\",\"portLocation\":\"中国沿海中部的海州湾西南岸、江苏省的东北端，位于北纬34°44\'，东经119°27\'（主要港区）\",\"portName\":\"连云港港口\"}', NULL, 1, '\r\n### Error updating database.  Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'port_facilities\' at row 1\r\n### The error may exist in file [C:\\Users\\16789\\Desktop\\总文件\\项目\\Cargo-ship-carrying-visualization-platform-system1\\cargo-port\\target\\classes\\mapper\\port\\BPortMapper.xml]\r\n### The error may involve com.ruoyi.port.mapper.BPortMapper.insertBPort-Inline\r\n### The error occurred while setting parameters\r\n### SQL: insert into b_port          ( port_name,             port_location,             port_facilities,             port_contact,             port_image )           values ( ?,             ?,             ?,             ?,             ? )\r\n### Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'port_facilities\' at row 1\n; Data truncation: Data too long for column \'port_facilities\' at row 1; nested exception is com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'port_facilities\' at row 1', '2023-12-06 16:08:45', 42);
